oxy_webhelp_navlinks = {"cal_getstarted-d4802e2588":{"topics":[{"title":"How should I use the different types of calendar entries?","shortdesc":"<p class=\"shortdesc\">You can schedule meetings, appointments, all day events, anniversaries, reminders, or event announcements on your Notes calendar. This topic explains some of the differences between these types of entries.<\/p>","href":"cal_entry_types_r.html","attributes":{"data-id":"cal_entry_types_r"},"menu":{"hasChildren":false},"tocID":"cal_entry_types_r-d4802e2599","topics":[]},{"title":"How do I add other calendars to my Notes calendar?","shortdesc":"<p class=\"shortdesc\">You can add a Google(TM) calendar, iCalendar, other person's Notes calendar, Notes Teamroom calendar, or Notes application calendar to your NotesÂ® calendar. The entries will display alongside your Notes calendar's entries, in a color that you choose.<\/p>","href":"cal_add_cal_t.html","attributes":{"data-id":"N10001"},"menu":{"hasChildren":false},"tocID":"N10001-d4802e2610","topics":[]},{"title":"What are categories and how can I use them in Calendar?","shortdesc":"<p class=\"shortdesc\">Categories are labels that help you organize items and find them more easily. You can use categories to organize calendar entries, to do items, contacts, or groups. You can assign category colors, so entries in a category appear in a different color on your calendar.<\/p>","href":"cal_categories_c.html","attributes":{"data-id":"cal_categories_c"},"menu":{"hasChildren":false},"tocID":"cal_categories_c-d4802e2627","topics":[]}]}};